<!doctype html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta content="width=device-width, user-scalable=no, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0"
          name="viewport">
    <meta content="ie=edge" http-equiv="X-UA-Compatible">
    <link href="/favicon.png" rel="icon" type="image/x-icon">
    <link href="./styles.css" rel="stylesheet">
    <title> Typescript Boilerplate </title>
</head>
<body>
<nav>
</nav>
<section class="banner">
    <div class="banner__holder">
        <div class="banner__holder-txt">
            <h1>Licenses</h1>
            <p class="banner__holder-txt-p"></p>
        </div>
    </div>
</section>
<section class="page">
    <section class="photography">
        <h2>Photography</h2>
        <p class="photography-P"></p>
    </section>
    <section class="unsplash">
        <h3>unsplash</h3>
        <div class="unsplash__images">
        </div>
    </section>
    <section class="pexels">
        <h4>Pexels</h4>
        <div class="pexels__images">
        </div>
    </section>
    <section class="font">
        <h5>Font</h5>
        <div class="font__holder">
        </div>
        <h6>Icon</h6>
        <div class="font__icons"></div>
    </section>
    <footer>
        <div class="footer__main">
            <div class="footer_main__social">
                <div class="footer__main__social__logo">
                </div>
                <p class="footer__main__social-p">
                    It is a long established fact that a reader will be distracted lookings.
                </p>
                <div class="footer__main__social__buttons">
                </div>
            </div>
            <div class="footer__main__pages">
            </div>
            <div class="footer__main__services">
            </div>
            <div class="footer__main__contact">
            </div>
        </div>
        <div class="footer__copyright">
        </div>
    </footer>
</section>

<script src="/scripts.js"></script>
</body>
</html>
